      <div className="login4">
        <div className="dont-have-an-container">
          <b>Login</b>
          <span>{` `}</span>
        </div>
      </div>
      <button className="forgot-password-wrapper">
        <div className="forgot-password1" onClick={onForgotPasswordTextClick}>
